package whut.inis.show.po;

public class AlertInfo {
	private String infoLei;
	private String infoContent;
	public AlertInfo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public AlertInfo(String infoLei, String infoContent) {
		super();
		this.infoLei = infoLei;
		this.infoContent = infoContent;
	}
	public String getInfoLei() {
		return infoLei;
	}
	public void setInfoLei(String infoLei) {
		this.infoLei = infoLei;
	}
	public String getInfoContent() {
		return infoContent;
	}
	public void setInfoContent(String infoContent) {
		this.infoContent = infoContent;
	}
	

}
